import React from 'react';
import './ObjectsPriceContent.css';

const ObjectsPriceContent = ({ formData, handleInputChange, handleFileChange, success, apartments, onApartmentClick }) => {
    
    const handleApartmentClick = (e) => {
        console.log("select apartment");
        onApartmentClick(); // Call the function to open the modal
    };
    
    const handleGarageClick = (e) => {
        console.log("select garage");
    };

    const handleParkingPlaceClick = (e) => {
        console.log("select parking-place");
    };

    return (
        <div className="contract-purchaser-broker-container">
            {/* Sell Objects and price*/}
            <div className="contract-container">
                {success && <div className="alert alert-success">{success}</div>}
                <div className="form-group contract-file-group">
                    <label htmlFor="contractNumber">Add Objects</label>
                    <div className="input-file-container">
                        <div className="file-icon" onClick={handleApartmentClick}>
                            <svg xmlns="http://www.w3.org/2000/svg" width="56" height="46" fill="currentColor" className="bi bi-building-add" viewBox="0 0 16 16">
                                <path d="M12.5 16a3.5 3.5 0 1 0 0-7 3.5 3.5 0 0 0 0 7m.5-5v1h1a.5.5 0 0 1 0 1h-1v1a.5.5 0 0 1-1 0v-1h-1a.5.5 0 0 1 0-1h1v-1a.5.5 0 0 1 1 0"/>
                                <path d="M2 1a1 1 0 0 1 1-1h10a1 1 0 0 1 1 1v6.5a.5.5 0 0 1-1 0V1H3v14h3v-2.5a.5.5 0 0 1 .5-.5H8v4H3a1 1 0 0 1-1-1z"/>
                                <path d="M4.5 2a.5.5 0 0 0-.5.5v1a.5.5 0 0 0 .5.5h1a.5.5 0 0 0 .5-.5v-1a.5.5 0 0 0-.5-.5zm3 0a.5.5 0 0 0-.5.5v1a.5.5 0 0 0 .5.5h1a.5.5 0 0 0 .5-.5v-1a.5.5 0 0 0-.5-.5zm3 0a.5.5 0 0 0-.5.5v1a.5.5 0 0 0 .5.5h1a.5.5 0 0 0 .5-.5v-1a.5.5 0 0 0-.5-.5zm-6 3a.5.5 0 0 0-.5.5v1a.5.5 0 0 0 .5.5h1a.5.5 0 0 0 .5-.5v-1a.5.5 0 0 0-.5-.5zm3 0a.5.5 0 0 0-.5.5v1a.5.5 0 0 0 .5.5h1a.5.5 0 0 0 .5-.5v-1a.5.5 0 0 0-.5-.5zm3 0a.5.5 0 0 0-.5.5v1a.5.5 0 0 0 .5.5h1a.5.5 0 0 0 .5-.5v-1a.5.5 0 0 0-.5-.5zm-6 3a.5.5 0 0 0-.5.5v1a.5.5 0 0 0 .5.5h1a.5.5 0 0 0 .5-.5v-1a.5.5 0 0 0-.5-.5zm3 0a.5.5 0 0 0-.5.5v1a.5.5 0 0 0 .5.5h1a.5.5 0 0 0 .5-.5v-1a.5.5 0 0 0-.5-.5zm3 0a.5.5 0 0 0-.5.5v1a.5.5 0 0 0 .5.5h1a.5.5 0 0 0 .5-.5v-1a.5.5 0 0 0-.5-.5z"/>
                            </svg>
                        </div>
                        <label> Click to add apartments</label>
                    </div>
                </div>
            </div>

            {/* List of apartments */}
            <div className="objects-list">
                {apartments.map((apartment) => (
                    <div className="object-item" key={apartment.id}>
                        <span>{apartment.name}</span>
                        <span>{apartment.price} $</span>
                        <button onClick={handleApartmentClick}>Select</button>
                    </div>
                ))}
            </div>
        </div>
    );
};

export default ObjectsPriceContent;
